	} = useContext(SetDateContext)

	const buildYears = (year) => {
		const years = [year]
		for (let i = 1; i < 5; i++) {
			years.push(addYears(new Date(year), i))
			years.unshift(addYears(new Date(year), -i))
		}
		return years
	}
	const years = buildYears(startOfYear(waypoint))

	const yearIsCurrent = (date) => {
